    def simulate(chameleons):
        while True:
            collisions = []
            for i in range(len(chameleons)):
                for j in range(i + 1, len(chameleons)):
                    if chameleons[i][1] == chameleons[j][1] and chameleons[i][2] * chameleons[j][2] == -1:
                        if chameleons[i][2] == 1:
                            collisions.append((i, j))
                        else:
                            collisions.append((j, i))

            if not collisions:
                break

            for i, j in collisions:
                chameleons[i][2] = -chameleons[i][2]
                chameleons[j][2] = (chameleons[i][0] + chameleons[j][0]) % K
                chameleons[i][0] = chameleons[j][0]

        return [chameleon[0] for chameleon in chameleons]

    def parse_input(stdin):
        N, K, L = map(int, stdin.readline().split())
        chameleons = []
        for _ in range(N):
            d, b, direction = stdin.readline().split()
            chameleons.append([int(d), int(b), 1 if direction == 'D' else -1])

        return chameleons

    def main(stdin):
        chameleons = parse_input(stdin)
        trips = [0] * K
        for chameleon in simulate(chameleons):
            trips[chameleon[1]] += chameleon[0]

        return trips

    return '\n'.join(map(str, main(stdin)))

