    def has_even_pile(piles):
        for pile in piles:
            if pile % 2 == 0:
                return True
        return False

    def next_state(piles, k):
        new_piles = []
        for pile in piles:
            if pile % 2 == 0:
                new_piles.extend([pile // 2] * (pile // 2))
            else:
                new_piles.append(pile)
        return new_piles

    def remove_cow(piles):
        non_empty_piles = [p for p in piles if p > 0]
        if not non_empty_piles:
            return piles
        pile_to_modify = min(non_empty_piles)
        index = piles.index(pile_to_modify)
        piles[index] -= 1
        return piles

    def lieges_of_legendre(piles, k):
        if not piles:
            return "Nicky"
        if not has_even_pile(piles):
            return "Kevin"
        return lieges_of_legendre(next_state(remove_cow(piles), k), k)

    return lieges_of_legendre(a, k)

